import React, { Component } from 'react';
import M from "materialize-css";


class RelatoryList extends Component{

  componentDidMount() {
    M.Tabs.init(this.Tabs);
  }

  render() {
    return(
      <div className="home">
        <div className="relatory">
            <h5>Relat√≥rios</h5>
        </div>
        <div class="row">
          <div class="col s12">
          <div>
        <ul
          ref={Tabs => {
            this.Tabs = Tabs;
          }}
          id="tabs-swipe-demo"
          className="tabs tabs-fixed-width tab-demo z-depth-1"
        >
          <li className="tab col s3">
            <a href="#test-swipe-1">Test 1</a>
          </li>
          <li className="tab col s3">
            <a href="#test-swipe-2">Test 2</a>
          </li>
          <li className="tab col s3">
            <a href="#test-swipe-3">Test 3</a>
          </li>
        </ul>

        <div id="test-swipe-1" className="col s12">
          Test 1
        </div>
        <div id="test-swipe-2" className="col s12 ">
          Test 2
        </div>
        <div id="test-swipe-3" className="col s12 ">
          Test 3
        </div>
      </div>
          </div>
        </div>







      </div>
    )
  }
}

export default RelatoryList
